import React, { Component } from "react";

export default class TryGlassesApp_Body extends Component {
  render() {
    return (
      <div className="">
        <div
          style={{
            background: "no-repeat url(glassesImage/model.jpg)",
            height: "320px",
            width: "20%",
            margin: "auto",
            backgroundSize: "contain",
            backgroundPosition: "center",
            position: "relative",
          }}
        >
          <img
            style={{
              position: "absolute",
              top: "24%",
              left: "598px",
              width: "135px",
              height: "53px",
              opacity: 0.7,
            }}
          ></img>
          <div
            style={{
              position: "absolute",
              bottom: "0",
              left: "0",
              textAlign: "left",
              backgroundColor: "orange",
              filter: "blur(2px)",
            }}
            className="p-2"
          >
            <h6 style={{ color: "blue", fontWeight: "Bold", opacity: "1" }}>
              GUCCI G8850U
            </h6>
            <p className="text-white small">
              Light pink square lenses define these sunglasses, ending with
              amother of pearl effect tip.
            </p>
          </div>
        </div>
      </div>
    );
  }
}
